import React from 'react';
import TextField from '@material-ui/core/TextField';
import { makeStyles } from '@material-ui/core/styles';
import "./Register.css";

const useStyles = makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: 200,
    },
  },
}));

export default function Register() {
  const classes = useStyles();

  return (<>
    <h1>Register</h1>
    <form>
      <div>
        <TextField id="name" label="name" variant="outlined" className="smallWidth"/>
        <TextField id="surname" label="surname" variant="outlined" className="name" classes="smallWidth"/>
      </div>
      <div>
         <TextField id="idNUmber" label="Id Number" variant="outlined"  className="fullWidth" />
      </div>
      <div>
         <TextField id="contactNumber" label="Contact Number" variant="outlined" className="fullWidth"/>
      </div>
      <div>
          <TextField id="altNumber" label="Alternative number" variant="outlined" className="fullWidth"/>
      </div>
      <div>
           <TextField id="email" label="Email" variant="outlined" className="fullWidth"/>
      </div>
    </form>
  </>);
}
